import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 3.2-5207 Powers and duties of Commissioner; obstruction unlawful.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5207.md","filePath":"vacode/3.2-5207.md"}'),a={name:"vacode/3.2-5207.md"},i=r('<h1 id="§-3-2-5207-powers-and-duties-of-commissioner-obstruction-unlawful" tabindex="-1">§ 3.2-5207 Powers and duties of Commissioner; obstruction unlawful. <a class="header-anchor" href="#§-3-2-5207-powers-and-duties-of-commissioner-obstruction-unlawful" aria-label="Permalink to &quot;§ 3.2-5207 Powers and duties of Commissioner; obstruction unlawful.&quot;">​</a></h1><p>The Commissioner shall administer and enforce the regulations adopted pursuant to § <a href="http://law.lis.virginia.gov/vacode/3.2-5206/" target="_blank" rel="noreferrer">3.2-5206</a> except as provided in § <a href="http://law.lis.virginia.gov/vacode/3.2-5208/" target="_blank" rel="noreferrer">3.2-5208</a>. He is empowered, in the performance of his duties, to enter upon and to have free access to any establishment or area subject to the provisions of this article, or the regulations adopted hereunder. It shall be unlawful for any person to hinder, obstruct, or interfere with the Commissioner in the performance of his duties under this article or under the regulations adopted pursuant to this article.</p><p>1970, c. 49, § 3.1-530.3; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),s=[i];function n(d,l,c,u,h,f){return t(),o("div",null,s)}const m=e(a,[["render",n]]);export{_ as __pageData,m as default};
